INSERT INTO `examen_medico` VALUES (1,'Examen físico','Un examen físico es una evaluación completa de tu salud general. Durante este examen, nuestro médico llevará a cabo una revisión de tus sistemas corporales, como el cardiovascular, respiratorio, musculoesquelético y neurológico, entre otros. Se realizarán mediciones como la presión arterial, el pulso y la auscultación del corazón y los pulmones.',30),(2,'Análisis de sangre','Los análisis de sangre son pruebas que permiten evaluar diversos aspectos de tu salud mediante el análisis de una muestra de sangre. Estos exámenes pueden incluir pruebas para medir los niveles de glucosa, lípidos, hormonas, vitaminas y minerales, así como para detectar infecciones o enfermedades.',50),(3,'Pruebas de orina','Las pruebas de orina son exámenes que analizan una muestra de tu orina para detectar posibles problemas de salud. Estas pruebas pueden revelar la presencia de infecciones del tracto urinario, enfermedades renales, diabetes, entre otros.',30),(4,'Radiografía','La radiografía es una técnica de diagnóstico por imagen que utiliza rayos X para obtener imágenes de las estructuras internas del cuerpo. Este examen es útil para detectar fracturas óseas, enfermedades pulmonares, obstrucciones intestinales y otras condiciones médicas.',100),(5,'Ecografía','La ecografía, también conocida como ultrasonido, utiliza ondas sonoras de alta frecuencia para crear imágenes en tiempo real de los órganos y tejidos internos del cuerpo. Este examen es seguro, no invasivo y se utiliza para evaluar el estado de órganos como el corazón, el hígado, los riñones, el útero y el ovario, entre otros.',100),(6,'Electrocardiograma (ECG)','Un electrocardiograma (ECG) es un examen que registra la actividad eléctrica del corazón. Se colocan electrodos en el pecho, las extremidades y el abdomen para registrar la señal eléctrica y evaluar el ritmo cardíaco y la función cardíaca.',100),(7,'Mamografía',' La mamografía es una prueba de diagnóstico por imagen que se utiliza para detectar posibles anomalías en los senos. Este examen es especialmente útil en la detección temprana del cáncer de mama, ya que puede mostrar la presencia de masas o calcificaciones en los tejidos mamarios.',125),(8,'Colonoscopia','La colonoscopia es un procedimiento que permite examinar el interior del colon y el recto. Se utiliza un tubo flexible con una cámara en el extremo para detectar pólipos, inflamación, úlceras o signos de cáncer colorrectal.',200),(9,'Prueba de esfuerzo','Una prueba de esfuerzo, también conocida como prueba de ejercicio, evalúa cómo funciona el corazón durante el ejercicio físico. Durante este examen, se registra el ritmo cardíaco, la presión arterial y los síntomas mientras te ejercitas en una cinta de correr o en una bicicleta estacionaria.',75),(10,'Examen de la vista','El examen de la vista es una evaluación de la salud visual y la capacidad de enfoque. Durante este examen, el oftalmólogo realizará pruebas para medir la agudeza visual, la prescripción de lentes, la detección de enfermedades oculares y evaluará la coordinación ocular.',50);
